export default ({ products }) => {
  return (
    <div>
      {products.map(product => (
        <div>
          <div>
            <img src={product.imageURL} alt="" />
          </div>
          <div>
            <div className="product-name">{product.name}</div>
          </div>
        </div>
      ))}
    </div>
  );
};
